"use strict";

var PAGE = {
  data: {
    UPLOAD_API: 'https://www.jevescript.com/api/task/mobile'
  },
  init: function init() {
    this.bind();
  },
  bind: function bind() {
    $('#successfu-button').on('click', this.goButton);
  },
  goButton: function goButton() {
    var value = $('#input').get(0).value;
    var phone = PAGE.phoneNumber(value);

    if (value === '') {
      $('#prompt').text('手机号码不能为空');
      $('#prompt').css('display', 'block');
      return;
    }

    if (!phone) {
      $('#prompt').text('输入格式有误');
      $('#prompt').css('display', 'block');
      return;
    } // axios.post(PAGE.data.UPLOAD_API,{
    //   phone:value
    // }).then(res =>{
    //   console.log(res)
    //   $('#successfu').css('display','none');
    //   $('#succe').css('display','block');
    // }).catch(err => {
    //   console.log(err)
    // })


    $.ajax({
      type: 'POST',
      url: PAGE.data.UPLOAD_API,
      data: {
        phone: value
      },
      success: function success(res) {
        console.log(res);
        $('#successfu').css('display', 'none');
        $('#succe').css('display', 'block');
      },
      error: function error(err) {
        console.log(err);
      }
    });
  },
  phoneNumber: function phoneNumber(value) {
    return /^1[345678]\d{9}$/.test(value);
  }
};
PAGE.init();
